// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "@openzeppelin/contracts@4.4.1/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts@4.4.1/access/Ownable.sol";
import "@openzeppelin/contracts@4.4.1/security/Pausable.sol";
import "@openzeppelin/contracts@4.4.1/token/ERC1155/extensions/ERC1155Burnable.sol";
import "@openzeppelin/contracts@4.4.1/token/ERC1155/extensions/ERC1155Supply.sol";
import "@openzeppelin/contracts/utils/Strings.sol";


contract Koomz is ERC1155, Ownable, Pausable, ERC1155Burnable, ERC1155Supply {

    uint[] quantity = [3,1,2,4,1];
    uint[] supply;
    uint[] minted;
    uint public currentId = 0;
    uint256 public maxUserMint = 5;
    uint256 public cost = 0.01 ether;
    bool public revealed = false;

    constructor()ERC1155("ipfs://QmSx4Mxs5sw6UV4Vs8j7qDM2TsS6QTa1AMyXb3zKHFLY5z/{id}.json"){
        for( uint i=0; i < quantity.length; i++){
            for(uint x=0; x < quantity[i]; x++){
                supply.push(i);

            }
        }

        for (uint256 i = 0; i < supply.length; i++) {
            uint256 n = i + uint256(keccak256(abi.encodePacked(block.timestamp))) % (supply.length - i);
            uint256 temp = supply[n];
            supply[n] = supply[i];
            supply[i] = temp;
        }

    }

    // for testing 
    function getMinted()public onlyOwner view returns( uint[] memory){
        return minted;
    }

    function getSupply()public onlyOwner view returns( uint[] memory){
        return supply;
    }

    function maxSupply()public view returns( uint ){
        return supply.length;
    }

    function reveal() public onlyOwner() {
      revealed = true;
    }

    //  not revild user 
    function uri(uint _tokenId) override public view returns(string memory){

        /*
        if(revealed == false) {
            return "ipfs://QmREpAFfk91ChtUg854hChNB37vShJL7Tf2PjNEZY4btqY/13.json";
        }
        */
        uint256 imgIndex =  supply[_tokenId];

        return string(abi.encodePacked(
            "ipfs://QmSx4Mxs5sw6UV4Vs8j7qDM2TsS6QTa1AMyXb3zKHFLY5z/",
            Strings.toString(quantity[imgIndex]),
            ".json"
        ));
    }

   function burn(address account,uint256 id,uint256 value) public override {
        require(
            account == _msgSender() || isApprovedForAll(account, _msgSender()),
            "ERC1155: caller is not owner nor approved"
        );
        _burn(account, id, value);
    }


    function name() public pure returns(string memory){
        string memory collection = "Pistol";
        return collection;
    }

    function setURI(string memory newuri) public onlyOwner {
        _setURI(newuri);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    //bytes memory data
    function userMint(address account)
        public
        payable
    {
        require(currentId < maxUserMint , "All NFT have been minted");
        require(msg.value >= cost, "insufficient funds");
        _mint(account, currentId, 1, bytes(abi.encodePacked('heros by Nex')) );
        minted.push(supply[currentId]);
        currentId = currentId+1;
    }

    function adminMint(address account, uint256 amount)
        public
        onlyOwner
    {

        require(currentId < supply.length, string(abi.encodePacked("All NFT have been minted ", currentId, " ", supply.length  )));
        _mint(account, currentId, amount, bytes(abi.encodePacked('Heros by Nex')) );
        for( uint i=0; i < amount; i++){
            minted.push(supply[currentId]);
            currentId = currentId+1;
        }
    }

    function mintBatch(address to, uint256[] memory ids, uint256[] memory amounts, bytes memory data)
        public
        onlyOwner
    {
        _mintBatch(to, ids, amounts, data);
    }


    function _beforeTokenTransfer(address operator, address from, address to, uint256[] memory ids, uint256[] memory amounts, bytes memory data)
        internal
        whenNotPaused
        override(ERC1155, ERC1155Supply)
    {
        super._beforeTokenTransfer(operator, from, to, ids, amounts, data);
    }

    function withdraw() public onlyOwner{
    	require(address(this).balance > 0, "Balance is 0");
	    //payable(owner()).transfer(address(this).balance);
        (bool success,) = payable(msg.sender).call{
            value: address(this).balance
        }("");
        require(success);  
    }
}
